function getwoPlanes(builder, gvertices, gindices, opacity){
  const tmpMat = Mat4.fromTranslation(Mat4.zero(), Vec3.create(0, 42.5, 0))
  const m1 = Mat4();
  Mat4.mul(m1, tmpMat, Mat4.rotX90);

  const tmpMat2 = Mat4.fromTranslation(Mat4.zero(), Vec3.create(0, -42.5, 0));

  const m2 = Mat4();
  Mat4.mul(m2, tmpMat2, Mat4.rotX90);

  const r30 = Mat4.fromEuler(Mat4.zero(), Euler.create(30 * Math.PI / 180, 0, 0), 'XYZ');
  const m3 = Mat4();
  Mat4.mul(m3, m2, r30);


  builder.primitives({
      ref: 'plane1',
      tooltip: "Top Plane",
      opacity: opacity,
      instances: [m1]
  })
      .lines({
          vertices: gvertices,
          indices: gindices,
          width: 1.0,
          color: "#b9b0fa",
          custom: { molstar_line_params: { emissive: 1.0 } }
      });

  //1-6
  //

  builder.primitives({
      ref: 'plane2',
      tooltip: "Bottom Plane",
      opacity: opacity,
      instances: [m2]
  })
      .lines({
          vertices: gvertices,
          indices: gindices,
          width: 1.0,
          color: "#b9b0fa",
          custom: { molstar_line_params: { emissive: 1.0 } }
      });


}

