function dist2(x, y, z, q) {
  const dx = x - q[0];
  const dy = y - q[1];
  const dz = z - q[2];
  return dx * dx + dy * dy + dz * dz;
}

function pointInHemisphere(px, py, pz, cx, cy, cz, ux, uy, uz, side=1) {
  const vx = px - cx, vy = py - cy, vz = pz - cz;
  const dot = vx * ux + vy * uy + vz * uz;
  return side >= 0 ? (dot >= 0) : (dot <= 0);
}

//do an half spheres along given axis? 
function filterElectrofieldHemi(electrofield, cuA, cutoff2, axis = [0, 1, 0]) {
  const result = {};
  let points = [];
  let idx = [];
  const ax = axis[0], ay = axis[1], az = axis[2];
  const alen = Math.hypot(ax, ay, az) || 1;
  const ux = ax / alen, uy = ay / alen, uz = az / alen;  

  let c = 0;
  for (const key in electrofield) {
    const line = electrofield[key];
    let keep = false;
    // points = [];
    for (let i = 0; i < line.length; i += 6) {
      const x = line[i], y = line[i + 1], z = line[i + 2];
      const xx = line[i + 3], yy = line[i + 4], zz = line[i + 5];
      if (dist2(x, y, z, cuA) <= cutoff2 || dist2(xx, yy, zz, cuA) <= cutoff2) {
        if (pointInHemisphere(x, y, z, cuA[0], cuA[1], cuA[2], ux, uy, uz) || pointInHemisphere(xx, yy, zz, cuA[0], cuA[1], cuA[2], ux, uy, uz) ) {
          keep = true;
          points.push(x, y, z);
          points.push(xx, yy, zz);
          //break;
          idx.push(c);
          idx.push(c + 1);
          c = c + 2;
        }
      }
    }
    // if (keep) result[key] = points;
  }
  return { points: points, idx: idx };
}

